import React from 'react'
import Card from './Card';
import Sdata from './Sdata';


const Services = () => {
    return (
        <>
          <div className="my-5">
             <h1 className="text-center">Our Services</h1>
          </div>
          <div className="container-fluid mb-5">
            <div className="row">
                <div className="col-10 mx-auto">
                    
                    {
                        Sdata.map((val,ind)=>{
                            return(
                                <>
                                    <Card 
                                        imgsrc={v}
                                    />
                                </>
                            )

                        })
                    }
                
                </div>
            </div>
          </div>
        </>
    )
};

export default Services;
